export default function Detail() {
    const contentDiv = document.getElementById('leftContent');

    const detailContent = document.createElement('p');
    detailContent.textContent = '세부사항 나온다';

    contentDiv.appendChild(detailContent);

    console.log('세부사항 나옴');
}
